import React from 'react';

const menuItems = [
    { p: "Home" },
    { p: "User List" },
    { p: "Blog Post" },
    { p: "Login" },
    { p: "Sign Up" },
    { p: "Contact" }
];

const Menu = () => {
    return (
        <nav>
            <ul>
                {menuItems.map((item, index) => (
                    <li key={index}>
                        <a href={item.link}>{item.label}</a>
                    </li>
                ))}
            </ul>
        </nav>
    );
}

export default Menu;
